import React from 'react';

const Home = () => {
    return (
        <div className="home">
            <h1>Welcome to the Event Management App</h1>
            <p>Your one-stop solution for creating, managing, and attending events.</p>
            <div className="features">
                <h2>Features</h2>
                <ul>
                    <li>User Dashboards</li>
                    <li>Event Creation</li>
                    <li>Registration Management</li>
                    <li>On-Site Management</li>
                    <li>Waitlist Management</li>
                </ul>
            </div>
        </div>
    );
};

export default Home;
